import React from "react";
import {HeaderDesign, HeaderText, ImagemDesign} from '../Styles/Style';
import logo from '../assets/logo.png';
import styles from '../Styles/Header.module.css'

const Header = () => {

  return (
            <HeaderDesign>
                <ImagemDesign src={logo}/>
                <HeaderText>Vuesax</HeaderText>
          </HeaderDesign>
  )
}

export default Header;
